import React from 'react';

function Footer() {
  return (
    <footer style={{
      backgroundColor: '#222',
      color: 'white',
      padding: '15px',
      textAlign: 'center',
      position: 'fixed',
      bottom: 0,
      width: '100%'
    }}>
      <p>© 2025 Mohamed Adnane - Tous droits réservés</p>
      <p>Contact : medadnane999@gmail.com | Tel : 06 49 86 80 06 </p>
    </footer>
  );
}

export default Footer;
